con:config.script:
def test_Case_Name = testRunner.testCase.name
def currDateTime = new java.text.SimpleDateFormat("yyyy_MM_dd'_'hh_mm").format(new Date())

def proj_Root = context.expand( '${#Project#Proj_Root}' )
def environment = context.expand( '${#Project#environment}' )

proj_Root = proj_Root.replace("\\", "/")

log.info proj_Root
//First Create the Test Name Folder
def testName_Folder = "${proj_Root}/Results/${test_Case_Name}"
new File("${testName_Folder}").mkdir()

//Create the folder with the Env and timestamp.
//def currDateTime = context.expand( '${CreateTestProperties#CurrDateTime}' )
filePathString = "${testName_Folder}/${environment}_${currDateTime}"
new File("${filePathString}").mkdir()

log.info filePathString
testRunner.testCase.setPropertyValue("fileFolderPath", filePathString)

log.info environment

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def Add = testRunner.testCase.getTestStepByName( "Add" ).getAssertionStatus().toString()

//Get File path
def fileFolderPath = context.expand( '${#TestCase#fileFolderPath}' )

//Save REsponse XML
def responseXML = context.expand( '${Add#Response}' )
groovyUtils.setPropertyValue("Properties", "Response1", responseXML)

def test_Case_Name = context.expand( '${DataSource#Testcase}' )

def outputFile = "${fileFolderPath}/Server1Response_" + test_Case_Name + "_"+Add+".xml"
def of = new File(outputFile)
of.write(responseXML, "UTF-8")

groovyUtils.setPropertyValue("Properties", "Add", Add)

def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context)
def Add2 = testRunner.testCase.getTestStepByName( "Sub" ).getAssertionStatus().toString()

//Get File path
def fileFolderPath = context.expand( '${#TestCase#fileFolderPath}' )

//Save REsponse XML
def responseXML = context.expand( '${Sub#Response}' )

def test_Case_Name = context.expand( '${DataSource#Testcase}' )

def outputFile = "${fileFolderPath}/Server2Response_" + test_Case_Name + "_"+Add2+".xml"
def of = new File(outputFile)
of.write(responseXML, "UTF-8")


groovyUtils.setPropertyValue("Properties", "Sub", Add2)
